INSERT INTO `master_agenda` (`id`, `judul`, `tanggal`, `jam_mulai`, `jam_selesai`, `lokasi`, `keterangan`, `dibuat_oleh`, `created_at`, `updated_at`) VALUES
(7, 'Sosialisasi AD/ART', '2025-05-18', '08:34:00', '09:33:00', 'Rumah pak mulyono', 'Pembahasan terkait ADART', 'sekertaris', '2025-05-18 00:34:15', '2025-05-18 00:34:15'),
(8, 'Rapat pembahasan pembangunan fasum di blok IX, XA, XII', '2025-06-08', '20:15:00', '23:15:00', 'Rumah depan pak handoyo', '1. Dibuatkan form untuk persetujuan warga, untuk pembahasan fasumnya\r\n2. Permintaan donatur tidak mau disebutkan namanya dan pembuatan RAB diakomodir oleh bidang pembangunan\r\n3. Paguyuban bisa membantu konsumsi dan air minum\r\n4. Terkait terguran akan di lakukan koordinator sebagai pihak pertama yang melakukan penagihan\r\n5. Tanda tangan surat teguran terdiri dari lingkungan, bendahara dan mengetahui ketua paguyuban \r\n6. ', 'Sekertaris', '2025-06-08 13:15:25', '2025-06-08 14:38:16'),
(9, 'Rapat dalam rangka menyambut Hari Ulang Tahun Kemerdekaan RI ke-80', '2025-06-21', '19:04:00', '23:59:00', 'Depan musholla Assallam Perum TSI', '<br> <ul>\r\n  <li><strong>Pembentukan Rukun Kematian (Rukem)</strong><br>\r\n      Sedang direncanakan pembentukan Rukem dana diambil dari iuran warga\r\n  </li>\r\n\r\n  <li><strong>Pembangunan Gudang Penyimpanan Barang (Blok 11)</strong>\r\n    <ul>\r\n      <li>Surat pernyataan telah disampaikan</li>\r\n      <li>Rencana Anggaran Biaya (RAB) sudah jelas</li>\r\n      <li>Progres pembangunan saat ini mencapai 60%</li>\r\n    </ul>\r\n  </li>\r\n\r\n  <li><strong>Pembangunan Gapura Pintu Masuk Taman Sukodono Indah</strong><br>\r\n      Masih dalam tahap perencanaan. Diperlukan perencanaan teknis dan sosialisasi yang baik kepada warga.\r\n  </li>\r\n\r\n  <li><strong>Terkait Surat Izin Hajatan Warga</strong><br>\r\n      Surat ini bersifat sensitif terutama terkait dana/iuran. Diharapkan koordinator blok dapat menyampaikan secara jelas bahwa dana tersebut tidak masuk ke dalam kas paguyuban, agar tidak menimbulkan asumsi negatif di kalangan warga.\r\n  </li>\r\n\r\n  <li><strong>Laporan Keuangan Paguyuban (per Juni 2025)</strong>\r\n    <ul>\r\n      <li>Total dana per Juni: Rp 22.950.000</li>\r\n      <li>Sudah terpakai untuk operasional sebesar Rp 4.500.000 (dari Pak Adit)</li>\r\n      <li>THR 2 bulan: Rp 1.400.000</li>\r\n      <li>Sisa saldo masih akan diperhitungkan dalam laporan bulan berjalan</li>\r\n      <li><em>Catatan:</em> Laporan keuangan disampaikan per bulan. Laporan bulan Juni akan dilaporkan pada 20 Juli 2025.</li>\r\n    </ul>\r\n  </li>\r\n\r\n  <li><strong>Iuran Warga</strong>\r\n    <ul>\r\n      <li>Sisa iuran ibu-ibu (Rp 10.000/bulan) untuk 2024: Rp 4.761.000</li>\r\n      <li>Total iuran 2025 (Januari hingga saat ini): Rp 5.620.000</li>\r\n      <li>Total iuran terkumpul: Rp 10.381.000</li>\r\n      <li>Pembagian penggunaan:\r\n        <ul>\r\n          <li>50% untuk kegiatan Agustusan</li>\r\n          <li>30% untuk Halalbihalal</li>\r\n          <li>20% untuk kegiatan Keagamaan</li>\r\n        </ul>\r\n      </li>\r\n    </ul>\r\n  </li>\r\n\r\n  <li><strong>Rencana Kegiatan Agustusan 2025</strong>\r\n    <ul>\r\n      <li>Modal awal kegiatan Agustusan: Rp 8.950.000</li>\r\n      <li>Tirakatan: 16 Agustus 2025 di Blok 6</li>\r\n      <li>Panggung hiburan: di Blok 9</li>\r\n      <li>Jalan Sehat dan Karnaval: Sabtu, 23 Agustus 2025</li>\r\n      <li>Lomba-lomba: akan dilaksanakan pertengahan Juli</li>\r\n    </ul>\r\n  </li>\r\n\r\n  <li><strong>Struktur Kepanitiaan Agustusan</strong>\r\n    <ul>\r\n      <li>Ketua: Pak Eric</li>\r\n      <li>Wakil Ketua: Pak Panca</li>\r\n      <li>Sekretaris: Pak Angger</li>\r\n      <li>Bendahara: Pak Adit</li>\r\n      <li>Sie Acara: Pak Adi dan pak Agave</li>\r\n    </ul>\r\n  </li>\r\n\r\n  <li><strong>Kegiatan Pendukung Agustusan</strong>\r\n    <ul>\r\n      <li>Pembersihan saluran air (selokan) akan dilakukan terlebih dahulu</li>\r\n      <li>Setelah itu, dilakukan pengecatan dan pemasangan umbul-umbul dalam kerja bakti bersama akhir Juli</li>\r\n      <li>Lampu hias akan menggunakan listrik dari PJU (gratis selama bulan Agustus)</li>\r\n      <li>Pemasangan MCB PJU untuk blok yang belum memiliki MCB dijadwalkan pada 13 Juli 2025</li>\r\n    </ul>\r\n  </li>\r\n</ul>', 'Sekertaris', '2025-06-21 13:05:29', '2025-06-22 10:50:38'),
(10, 'Rapat Koordinasi Paguyuban TSI ', '2025-08-10', '19:00:00', '22:30:00', 'Rumah pak handoyo lantai 2', '1. Akan dilakukan sosialisasi ulang untuk koordinator terkait web aplikasi\r\n2. Koordinator blok diharapkan bisa menyampaikan informasi secara menyeluruh terkait isu fasum dan tarif untuk bagi warga yang mengadakan tasyakuran', 'sekertaris', '2025-08-09 04:40:24', '2025-08-11 06:19:57');
